import {React, useMemo} from "react";
import {GoogleMap, useLoadScript, Maker} from "@react-google-maps/api";
import mapa from "../mapa.css";



const Mapa = () => {
    
    
    const {isLoaded} =useLoadScript({
        googleMapsApiKey: "AIzaSyABrPSW5wCdp8-zXy--gxASbMishW-4PR0",
    });

    if(!isLoaded) return <div>Loading...</div>;
    return(

        <GoogleMap zoom={10} center={{lat: 44,lng: -80}} mapContainerClassName="width:100%; height:100vh;"></GoogleMap>
    )
    
}

export default Mapa;
